const Footer = () => (
  <div id="footer" className="section">
    <h2 className="title is-2">Made with ❤️ in Cincinnati.</h2>
    <p>Copyright 2017 &copy; All Rights Reserved by <a href="http://hill7.org">Hillman Accelerator</a></p>
    <style jsx>{`
      #footer {
        background-color: #282828;
        text-align:center;
        color: white;
      }
      .title {
        color: white;
      }
      a {
        color:white;
      }
    `}</style>
  </div>
)

export default Footer
